  return (
    <div className="holder">
      <p>text</p>
      <Header className="header">
        <Navbar />
        <div className="header-content">
          <h2 className="header-title"> find your book of choice.</h2>
          <br />
          <p className="header-text">Welcome to my book store!</p>
          <SearchForm />
        </div>
      </Header>
    </div>
  );
};

export default Header;
